import axios from "axios"

const KEY = "AIzaSyDqTkgLrbg4aJy9bPhT2iL5ETNJ43y6CB4"

export default axios.create({
    baseURL: `https://gmail.googleapis.com/gmail/v1/users/${email}/messages`,
    params: {
        part: "snippet",
        maxResult: 10,
        key: KEY,
    }
});
